import React from 'react'
import {useSelector, useDispatch} from "react-redux"
import Card from '../Card/Card'
import styles from './Favorites.module.css'
import {filterCards, orderCards} from "../Redux/Actions"

 const Favorites = ()=> {
     
     const favorites = useSelector((state)=> state.myFavorites)
     
     const dispatch = useDispatch();
     const handleOrder = (e)=>{
         dispatch(orderCards(e.target.value))
        }
        
        
        console.log("aqui estoy")
    const handleFilter = (event) => {
              dispatch(filterCards(event.target.value));
            };


    // // /*   const filter = useRef(null);
    //     const order = useRef(null); 
          
           const handleReset = (e) => {
             dispatch({ type: "RESET" });
             document.getElementById("filterSelect").selectedIndex = 0;
             document.getElementById("orderSelect").selectedIndex = 0;
           };
        
           return (
             <div className={styles.background}>
               <div className={styles.containerFav}>
             <div className={styles.leftContainer}>
                   <h1 className={styles.tituloFavoritos}>Mis Favoritos</h1>
        
                   <div className={styles.selectores}>
                     <select
                       id="orderSelect"
                       onChange={handleOrder}
                   defaultValue="order"
                     >
                       <option value="order" disabled>
                         Ordenar en
                       </option>
                       <option value="Ascendente">Ascendente</option>
                       <option value="Decendente">Descendente</option>
                     </select>
        
                     <select
                       id="filterSelect"
                       onChange={(event) => {
                         if (event.target.value === "reset") {
                           handleReset();
                         } else {
                           handleFilter(event);
                         }
                       }}
                       defaultValue="filter"
                     >
                       <option value="filter" disabled>
                         Filtrar por
                       </option>
                       <option value="Male">Masculino</option>
                       <option value="Female">Femenino</option>
                       <option value="Genderless">Sin Genero</option>
                       <option value="reset">Restablecer</option>
                     </select>
        
                    {/*  <button value="reset" onClick={handleReset}>
                   Restablecer
                 </button> */}
                   </div>
                 </div>
        
                 <div className={styles.rightContainer}>
                   <div className={styles.containerFavoritos}>
                     {
         favorites.map
         ((fav) => (
                       <Card key={
         fav.id
         } {...fav} isFavorite={true} />
                     ))}
               </div>
                 </div>
               </div>
             </div>
           );
         }
        
         export default Favorites;

